import React from 'react'
//loader
const Loader = () => {
  return (
    <>
    <div className="loader">
   <h1>Loading
   <div class="dots"><span class="dot s"></span><span class="dot t"><span class="dot l"></span></span></div>
{/* </h1><a class="abs-twitter" href="https://twitter.com/AbubakerSaeed96" rel="nofollow noreferrer" target="_blank">
  <svg class="twitter-icon" viewBox="0 0 32 32" height="28px">
    <path fill="#1da1f2" d="M32 7.075c-1.175 0.525-2.444 0.875-3.769 1.031 1.356-0.813 2.394-2.1 2.887-3.631-1.269 0.75-2.675 1.3-4.169 1.594-1.2-1.275-2.906-2.069-4.794-2.069-3.625 0-6.563 2.938-6.563 6.563 0 0.512 0.056 1.012 0.169 1.494-5.456-0.275-10.294-2.888-13.531-6.862-0.563 0.969-0.887 2.1-0.887 3.3 0 2.275 1.156 4.287 2.919 5.463-1.075-0.031-2.087-0.331-2.975-0.819 0 0.025 0 0.056 0 0.081 0 3.181 2.263 5.838 5.269 6.437-0.55 0.15-1.131 0.231-1.731 0.231-0.425 0-0.831-0.044-1.237-0.119 0.838 2.606 3.263 4.506 6.131 4.563-2.25 1.762-5.075 2.813-8.156 2.813-0.531 0-1.050-0.031-1.569-0.094 2.913 1.869 6.362 2.95 10.069 2.95 12.075 0 18.681-10.006 18.681-18.681 0-0.287-0.006-0.569-0.019-0.85 1.281-0.919 2.394-2.075 3.275-3.394z"></path>
  </svg></a> */}</h1></div>

    </>
  )
}



// portfolio
const Portfolio = ({ portfolioData }) => {
  return (
    <>
      {
        portfolioData.map((curElem) => {
          return (
            <>
              <div class="grid-item">
                <div class="gallery-image">
                  <img src={curElem.image} alt="" />
                  <div class="img-overlay">
                    <div class="plus"></div>
                    <div class="img-description">
                      <h3>{curElem.description}</h3>
                      <h5>View Demo</h5>
                    </div>
                  </div>
                </div>
              </div>
            </>
          )
        })
      }
    </>
  )
}
// header
const Header = ({ headerData }) => {
  return (
    <>
      {
        headerData.map((curMenu) => {
          return (
            <>
              <li>
                <a href={'#' + curMenu.menu}>{curMenu.menu}</a>
              </li>
            </>
          )
        })
      }
    </>
  )
}
// services
const Services = ({ serviceData }) => {

  // var de=document.getElementById('checkbox');
  // console.log("sanket"+de)
  // console.log(myFunction());
  return (
    <>
      {
        serviceData.map((curService) => {

          return (
            <>
              <div class="card-wrap">
               
                {/*<button onClick={()=>myInput()}>click here</button> */}
                <div class="card" data-card={curService.title}>
                  <div class="card-content z-index">

                    {/* {(()=>{
  myInput();
  // var cd= document.getElementById('checkbox')
  // if(0){
  //   alert('hello');
  // }
  // else{
  //   alert('hell');
  // }

})()

} */}

                    <img src={'https://img.icons8.com/external-justicon-lineal-justicon/6004/'+curService.color+curService.icon} className="icon" alt="" />
                    <h3 class="title-sm">{curService.title}</h3>
                    <p class="text">
                      {curService.description}
                    </p>
                    <a href="#" class="btn small">Read more</a>
                  </div>
                </div>
              </div>

            </>
          )
        })
      }

    </>
  )
}

const PortfolioNav = ({ portfolioList }) => {
  return (
    <>
      {
        portfolioList.map((curElem) => {
          return (
            <>
              <li>
                <a href='#'>{curElem}</a>
              </li>
            </>
          )
        })
      }

    </>
  )
}

const Blog = ({ blogData }) => {
  return (
    <>
      {
        blogData.map((curBlog) => {
          return (
            <>
              <div class="blog-wrap">
                <div class="blog-card">
                  <div class="blog-image">
                    <img src={curBlog.image} alt="" />
                  </div>

                  <div class="blog-content">
                    <div class="blog-info">
                      <h5 class="blog-date">{curBlog.date}</h5>
                      <h5 class="blog-user"><i class="fas fa-user"></i>{curBlog.author}</h5>
                    </div>
                    <h3 class="title-sm">{curBlog.title}</h3>
                    <p class="blog-text">
                      {curBlog.description}
                    </p>
                    <a href="#" class="btn small">Read more</a>
                  </div>
                </div>
              </div>
            </>
          )
        })
      }
    </>
  )
}


const Skills = ({ skillData }) => {
  return (
    <>
      {
        skillData.map((curSkill) => {
          const { title, progress } = curSkill
          return (
            <>

              <div class="skill html">
                
              
                <h3 class="skill-title">{title} </h3>
                <div className="progress-scale"><span className="progress" style={{marginLeft:`${progress}%` }}>{ `${progress}%`}</span></div>
                
                <div class="skill-bar">
               
                  <div class="skill-progress" style={{ width: `${progress}%` }}></div>
                </div>
              </div>
            </>
          )
        })
      }
    </>
  )
}



const Experience = () => {
  return (
    <>
      This is Experience
    </>
  )
}




export { Portfolio, Header, Services, PortfolioNav, Blog, Skills, Experience,Loader }
